<tr><td bgcolor="white" align="center" colspan="5"><span class="title2">Recent Ratings</span></td></tr><form method="post" action="last25Ratings.php" name="formLast25Ratings" id="formLast25Ratings"><tr><td bgcolor="#476A8E" align="left" colspan="5"><span class="title">1. Rating on <a href="http://www.bubooks.com/profdisplay.php?profid=340">Laurel Zeiss</a> in the Music department</span></td></tr><tr><td bgcolor="#FFFFFF" colspan="5" align="center" background = "bckground.gif"><table width = "100%" cellspacing = "0" cellpadding = "2" border = "1" bordercolor="#476A8E" rules ="none"><thead bgcolor="#CCCCCC"  align="center"><th><H4><u>Teaching Ability</u></h4></th><th><H4><u>Availability</u></h4></th><th><H4><u>Helpfulness</u></h4></th><th><H4><u>Workload*</u></h4></th></thead><tbody bgcolor="#FFFFFF" align="center"><tr><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star2.gif></td><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif></td><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star2.gif></td><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star2.gif><img src=images/star2.gif><img src=images/star2.gif></td></tr><tr align="left"><td colspan="4"><b>Opinion:</b> MUS 3315 - Dr. Zeiss is a LOVELY professor. In order to succeed in this class, you must put in ample work and time. The more you participate, the better you will do. This is also a result of the fact that tests are all essay type response and the more you work and show up in class, the higher the grade you will get on those. She is very wonderful and her use of technology was great! Very nice and doable course to take. - <b>Grade In Class:</b>A</td></tr><tr align="left"><td colspan="4"><b>Date Listed:</b> 2021-01-19</td></tr></tbody></table></td></tr><tr><td bgcolor="#476A8E" align="left" colspan="5"><span class="title">2. Rating on <a href="http://www.bubooks.com/profdisplay.php?profid=1639">Roy Garton</a> in the Religion department</span></td></tr><tr><td bgcolor="#FFFFFF" colspan="5" align="center" background = "bckground.gif"><table width = "100%" cellspacing = "0" cellpadding = "2" border = "1" bordercolor="#476A8E" rules ="none"><thead bgcolor="#CCCCCC"  align="center"><th><H4><u>Teaching Ability</u></h4></th><th><H4><u>Availability</u></h4></th><th><H4><u>Helpfulness</u></h4></th><th><H4><u>Workload*</u></h4></th></thead><tbody bgcolor="#FFFFFF" align="center"><tr><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif></td><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif></td><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif></td><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star2.gif><img src=images/star2.gif></td></tr><tr align="left"><td colspan="4"><b>Opinion:</b> REL 1310 - I took this class in-person in Fall 2020 and loved it! Dr. Garton is knowledgeable and helpful. The class is fast-paced and so are the lectures. As a Christian, his class challenged my faith for the better and gave me a greater understanding of the Bible. For Christians, a lot of the material and topics may be shocking or breakdown what you've always known. However, Dr. Garton does a great job of walking through the tough topics with the class and he gives advice on how to handle the shock. We had a reading every week from the Sumney book and a quiz that was based solely on the chapter we read. The quizzes were book-based and the tests were lecture-based. The tests were OPEN NOTE and not cumulative which was nice, plus he provided a study guide for organizing your notes. There were 2 reflection papers within the semester and you can choose from various topics. Those papers weren't difficult but he does care a lot about grammar. I would suggest allowing someone or the UWC to proofread your paper. Overall, I thoroughly enjoyed this class and looked forward to it! - <b>Grade In Class:</b>A</td></tr><tr align="left"><td colspan="4"><b>Date Listed:</b> 2021-01-19</td></tr></tbody></table></td></tr><tr><td bgcolor="#476A8E" align="left" colspan="5"><span class="title">3. Rating on <a href="http://www.bubooks.com/profdisplay.php?profid=437">J. Hitchcock</a> in the Art department</span></td></tr><tr><td bgcolor="#FFFFFF" colspan="5" align="center" background = "bckground.gif"><table width = "100%" cellspacing = "0" cellpadding = "2" border = "1" bordercolor="#476A8E" rules ="none"><thead bgcolor="#CCCCCC"  align="center"><th><H4><u>Teaching Ability</u></h4></th><th><H4><u>Availability</u></h4></th><th><H4><u>Helpfulness</u></h4></th><th><H4><u>Workload*</u></h4></th></thead><tbody bgcolor="#FFFFFF" align="center"><tr><td><img src=images/star1.gif><img src=images/star2.gif><img src=images/star2.gif><img src=images/star2.gif><img src=images/star2.gif></td><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star2.gif><img src=images/star2.gif><img src=images/star2.gif></td><td><img src=images/star1.gif><img src=images/star2.gif><img src=images/star2.gif><img src=images/star2.gif><img src=images/star2.gif></td><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star2.gif><img src=images/star2.gif><img src=images/star2.gif></td></tr><tr align="left"><td colspan="4"><b>Opinion:</b> ART2310 - Hitchcock was extremely unhelpful and unaccommodating. She is so closed minded about art styles and expects too much from her students.  Worst teacher I've ever had at Baylor  0% recommend she's so negative and talks so poorly about Baylor and the art department. - <b>Grade In Class:</b>B