/table></td></tr><tr><td bgcolor="#476A8E" align="left" colspan="5"><span class="title">10. Rating on <a href="http://www.bubooks.com/profdisplay.php?profid=3145">Meredith Palm</a> in the Neuroscience department</span></td></tr><tr><td bgcolor="#FFFFFF" colspan="5" align="center" background = "bckground.gif"><table width = "100%" cellspacing = "0" cellpadding = "2" border = "1" bordercolor="#476A8E" rules ="none"><thead bgcolor="#CCCCCC"  align="center"><th><H4><u>Teaching Ability</u></h4></th><th><H4><u>Availability</u></h4></th><th><H4><u>Helpfulness</u></h4></th><th><H4><u>Workload*</u></h4></th></thead><tbody bgcolor="#FFFFFF" align="center"><tr><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif></td><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif></td><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif></td><td><img src=images/star1.gif><img src=images/star1.gif><img src=images/star1.gif><img src=images/star2.gif><img src=images/star2.gif></td></tr><tr align="left"><td colspan="4"><b>Opinion:</b> 2306 - I have absolutely NOTHING NEGATIVE to say about Dr. Palm. I made this account to tell y'all to take her for absolutely anything she teaches. She is so knowledgeable and does a great job of breaking down the information as some of it can be pretty dense and hard to understand at first. This class does require a lot of reading and effort and it's definitely not the most exciting neuro class, however I honestly kind of liked it. Dr. Palm is so kind and always willing to help!!! Her tests are challenging but fair and I'm happy with the B I earned. Her grading scale is also set up to help you, not hurt you. A true queen. Thanks for coming to my ted talk. - <b>Grade In Class:</b>B</td></tr><tr align="left"><td colspan="4"